function App() {
  const [add, setadd]=useState(false);
  const [movie, setMovie] = useState(movies);

  return (
    <div className="App">
      <img src="data:image/jpeg;base64," alt='imdb logo' height='80'/>
      <h1>Top Rated Movies</h1>
      {movie.map((movies, index) => {
        return(
        <MovieInfo
          movInd={index}
          rank={movies.rank}
          movies={movies.name}
          pic={movies.pic}
          discription={movies.discription}
          directors={movies.directors}
          writers={movies.writers}
          stars={movies.stars}
          allMovies={movie}
          setMovie={setMovie}
        />)
})}
      <button className='btn btn-primary' onClick={()=>setadd(true)}>Add Movies</button>
      {add && <AddMovies movie={movie} setMovie={setMovie}/>}
      
    </div>
  );
}

function MovieInfo({
  movInd,
  rank,
  movies,
  pic,
  discription,
  directors,
  writers,
  stars,
  ...params
}) {
  const [Like, setLike] = useState(0);
  const [disLike, setDislike] = useState(0);
  const incrementLike = () => setLike(Like + 1);
  const deleteMovie=()=>{
    let tempMovies = params.allMovies;
    params.allMovies.forEach((mov,ind) => {
      if(movInd === ind){
        console.log(movInd,ind)
        tempMovies.splice(ind,1)
      }
    })
    params.setMovie([...tempMovies])
  }

  return (
    <div className="movieCard">
      <h2>{rank}</h2>
      <h5>
        Movie Name:<span>{movies}</span>
      </h5>
      <img height="250" src={pic} alt="moviePic" />
      <br />
      <br />
      <button className="btn-success button" onClick={incrementLike}>
        <i class="fas fa-thumbs-up"></i> {Like}
      </button>{" "}
      <button
        className="btn-danger button"
        onClick={() => setDislike(disLike + 1)}
      >
        <i class="fas fa-thumbs-down"></i> {disLike}
      </button>{" "}
      <button className='btn-secondary button' onClick={deleteMovie}>Delete</button>
      <br />
      <div className="msg">
        <h5>
          About: <span>{discription}</span>
        </h5>
        <h5>
          Directors: <span>{directors}</span>
        </h5>
        <h5>
          Writers: <span>{writers}</span>
        </h5>
        <h5>
          Stars: <span>{stars}</span>
        </h5>
      </div>
    </div>
  );
}
function AddMovies(params){
  console.log(params)
  const[movieName, setmovieName]=useState();
  const[rank, setrank]=useState();
  const[img, setimg]=useState();
  const[about, setabout]=useState();
  const[directors, setdiretors]=useState();
  const[writers, setwriters]=useState();
  const[stars, setstars]=useState();
  const updateArr=()=>{
    params.setMovie([...params.movie, {
      rank:+rank ,
      name: movieName,
      pic:img,
      discription:about,
      directors: directors,
      writers:writers,
      stars:stars
    }])
    

  }
  return(
    <div className='inputMovies'>
      <label for='movieName'>Movie Name:</label> <br/>
      <input type='text' id='movieName' onChange={(event)=>setmovieName(event.target.value)} placeholder='Enter movie name' size='40'></input><br/>
      <label for='rank'>Rank:</label> <br/>
      <input type='text' id='rank' onChange={(event)=>setrank(event.target.value)} placeholder='Enter movie rank' size='40'></input><br/>
      <label for='img'>Poster link:</label> <br/>
      <input type='text' id='img' onChange={(event)=>setimg(event.target.value)} placeholder='Paste the movie poster link' size='40' ></input><br/>
      <label for='about'>About:</label> <br/>
      <input type='text' id='about'onChange={(event)=>setabout(event.target.value)}  placeholder='Enter movie description' size='40'></input><br/>
      <label for='directors'>Directors:</label> <br/>
      <input type='text' id='directors'onChange={(event)=>setdiretors(event.target.value)}  placeholder='Enter movie director name' size='40'></input><br/>
      <label for='writer'>Writers Name:</label> <br/>
      <input type='text' id='writer' onChange={(event)=>setwriters(event.target.value)} placeholder='Enter movie writers name' size='40'></input><br/>
      <label for='stars'>Stars Name:</label> <br/>
      <input type='text' id='stars' onChange={(event)=>setstars(event.target.value)} placeholder='Enter movie stars name' size='40'></input>
     <br/> 
      <button className="btn btn-warning" onClick={updateArr}>Submit</button>
    </div>
  )
}

